// components/navbar.jsx
import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate();

    const handleLogout = () => {
        // Clear user data and navigate to login
        localStorage.removeItem('Token');
        navigate('/');
    };

    return (
        <nav style={{ display: 'flex', flexDirection: 'row', padding: '10px', borderBottom: '1px solid #ccc' }}>
            <Link to="/profile/projects" style={{ marginRight: '15px' }}>
                Projects
            </Link>
            <Link to="/profile/projects" style={{ marginRight: '15px' }}>
                Projects
            </Link>
            <Link to="/profile/projects" style={{ marginRight: '15px' }}>
                Projects
            </Link>
            <Link to="/profile/projects" style={{ marginRight: '15px' }}>
                Projects
            </Link>
            <button style={{ maxWidth: '100px' }} onClick={handleLogout}>Log Out</button>
        </nav>
    );
};

export default Navbar;
